        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Dekat dengan Kota Belud di Sabah, Pulau Mantanani menawarkan beberapa tempat menyelam terbaik di Borneo. Para snorkeler dan penyelam datang untuk berenang dengan kuda laut dan pari pada perjalanan sehari dari ibukota. Orang yang memiliki sertifikasi menyelam dapat menyelam di lebih dari 20 lokasi, termasuk tiga bangkai kapal. Setelah beberapa jam di Laut Cina Selatan, bersantai dan nikmati matahari terbenam Borneo yang terkenal di pantai berpasir putih yang murni."),
