        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Hutan Lumut, Cameron Highlands"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "Hutan Lumut adalah ekosistem alami yang hanya tumbuh di ketinggian yang lebih tinggi di Cameron Highlands dan pegunungan lain di Malaysia. Awan rendah yang ditiup angin menutupi pepohonan dengan kabut dan kelembaban, menciptakan habitat sempurna bagi lumut, pakis, lichen, dan anggrek. Hutan hujan tropis lembab ini juga menjadi tempat perlindungan bagi beragam spesies gunung, termasuk kupu-kupu, hewan pengerat, katak, burung, dan mamalia yang hanya ada di iklim dingin ini."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Gunung Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "Gunung Pulai adalah gunung setinggi 654 meter di Johor, Malaysia. Karena lokasinya yang dekat dan mudah diakses, tempat ini menjadi tujuan mendaki yang populer bagi warga Singapura dan penduduk setempat. Puncak Gunung Pulai tidak terbuka untuk umum karena dijaga oleh militer dan terdapat dua menara komunikasi. Gunung Pulai memiliki jalur melingkar sepanjang 14,3 kilometer di dekat Kulai, Johor, dengan sebuah air terjun dan tingkat kesulitan tertentu. Jalur ini juga digunakan untuk berkemah, bersepeda, berlari, dan berjalan di alam."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "Mass Rapid Transit (MRT) dibagi menjadi dua jalur; jalur pertama adalah jalur Sungai Buloh-Kajang sepanjang 51 km dengan 31 stasiun di sepanjang rutenya. Semua stasiun mulai beroperasi pada pukul 6.00 pagi setiap hari. Jam penutupan bervariasi tergantung stasiun masing-masing. Perjalanan tunggal dikenakan biaya mulai dari RM1.20. Hotline: 1800-82-6868"),
