            "Nasi Lemak adalah nasi harum yang dimasak dengan santan dan daun pandan, disajikan dengan sambal pedas, timun, ikan bilis goreng, telur, dan kacang tanah goreng. Paling enak dipasangkan dengan segelas teh tarik panas. Sebagian besar warung atau gerai juga menyediakan pilihan tambahan seperti ayam atau daging rendang, ayam goreng, sambal udang, dan banyak lagi."),
