        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "KL The Guide adalah buku panduan triwulanan, pertama kali diterbitkan pada Agustus 2007. Kami adalah buku panduan perjalanan gratis yang membantu pelancong merencanakan perjalanan mereka di sekitar ibu kota Malaysia, Kuala Lumpur. KL The Guide mencakup tips perjalanan, tempat untuk dijelajahi, lokasi ramah anak, hotel, dan banyak lagi. Dengan KL The Guide, menjelajahi kota menjadi lebih mudah."),
