        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Kunjungi Pulau Pangkor jika Anda mencari tempat tanpa turis. Terletak di dekat pantai Perak, pulau ini memiliki pantai kosong, air bersih, dan hutan lebat di tengahnya. Pengunjung menikmati kesempatan untuk berjemur di bawah pohon kelapa tanpa orang lain di sekitar. Juga, lihat benteng kolonial Belanda dan ambil foto di dermaga kayu tradisional."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Bukit Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "Bukit Panorama adalah sebuah bukit di Sungai Lembing, 45 kilometer di barat laut Kuantan. Dengan ketinggian 271 meter, hanya ada satu jalur pendakian. Mulailah dari dasar tangga dan terus mendaki ke atas. Ciri utama dari jalur ini adalah tangga dengan pegangan; hanya beberapa bagian pendek yang tidak memiliki tangga. Ketika Anda mencapai puncak bukit, Anda akan melihat pemandangan panorama dari kota sekitarnya. Pengunjung biasanya membutuhkan waktu antara 30 hingga 45 menit untuk mencapai puncak Bukit Panorama."),
        "parks": MessageLookupByLibrary.simpleMessage("Kafe"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Taman Nasional Penang, Penang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Ini adalah taman nasional terkecil di Malaysia, dengan luas 23 kilometer persegi, tetapi hutan berpantai ini adalah rumah bagi monyet daun perak, lemur terbang, kucing macan, dan berbagai spesies kadal, amfibi, dan reptil. Aktivitas seperti berjalan di hutan dan naik perahu ke pantai berpasir emas yang tenang akan membuat hari Anda penuh keseruan. Ada dua jalur utama di taman ini: satu yang membawa Anda menyusuri pantai ke Pantai Monyet, dan yang lainnya yang melintasi bukit melalui hutan hingga ke beberapa pantai yang lebih terpencil, tempat Suaka Penyu berada."),
