        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "Pulau Langkawi adalah rumah bagi beberapa pantai terbaik di Semenanjung Malaysia. Pulau ini menggabungkan pegunungan dan hutan bakau dengan garis pantai yang berkilauan. Lakukan perjalanan sehari ke Pulau Dayang Bunting yang terdaftar di UNESCO, beri makan elang, dan lihat monyet berenang mencari makanan. Atau, bawa handuk Anda dan berjemur di Pantai Cenang sebelum menikmati minuman di bar tepi pantai. Keuntungan lain adalah pulau ini bebas pajak, jangan ragu untuk berbelanja!"),
        "pulauRedang": MessageLookupByLibrary.simpleMessage("Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Salah satu pulau terbesar di pantai timur Malaysia, Pulau Redang terkenal dengan airnya yang jernih dan pantai berpasir putih. Pulau ini adalah salah satu dari sembilan pulau yang membentuk taman perlindungan laut yang menawarkan wisatawan kesempatan untuk snorkeling dan menyelam. Pantai ini penuh dengan pasir putih lembut. Anda bisa melihat karang dan ikan hanya beberapa meter dari pantai."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "Bus RapidKL sering terlihat di sebagian besar stasiun kereta dan biasanya berfungsi sebagai moda transportasi transit langsung bagi penumpang untuk mencapai tujuan mereka. Setiap perjalanan di bus dapat menelan biaya hingga RM5.00 per perjalanan yang dapat dibayar menggunakan uang tunai atau dengan mengetuk kartu Touch n Go saat masuk dan keluar. Hotline: 03-7885 2585"),
