            "Air Terjun Tujuh Sumur, juga dikenal sebagai Jalan Telaga Tujuh, terletak sekitar 20 menit berjalan kaki dari Jembatan Langit Langkawi yang terkenal dan merupakan salah satu atraksi alam paling menakjubkan di pulau ini. Air terjun ini jatuh dari Gunung Mat Cincang, puncak tertinggi kedua di Langkawi, dan populer di kalangan turis dan penduduk lokal. Tinggi total jatuhnya air adalah 91 meter, namun hanya sebagian kecil yang dapat dilihat dari bawah. Menurut legenda, air terjun ini adalah rumah bagi peri dan sungainya memiliki khasiat yang menenangkan. Air terjun ini terlihat magis karena dikelilingi oleh alam, dengan flora dan fauna yang kaya."),
