        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "Malaysia dikaruniai banyak hutan hujan yang menawarkan pemandangan air terjun yang menakjubkan. Air Terjun Pelangi terletak sekitar 45 kilometer di barat laut Kuantan, Semenanjung Malaysia, di kota Sungai Lembing. Setiap pagi, antara pukul 9 dan 10 pagi, sinar matahari menyentuh air terjun di dasar air terjun, menciptakan pelangi yang indah. Orang-orang dari seluruh dunia datang untuk melakukan perjalanan satu setengah jam hanya untuk menyaksikan keindahan alam ini. Air Terjun Pelangi adalah air terjun besar yang tersembunyi di area hutan hujan Sungai Lembing, dapat dicapai dengan kendaraan 4WD dan mendaki."),
